import styled from "styled-components"

const Container = styled.div`
    width: 100%;
    height: 100%;
`
const H1 = styled.h1`
    font-weight: bold;
    font-size: 40px;
`
const H2 = styled.h2`

`
const H3 = styled.h3`

`
const H4 = styled.h4`

`

const P = styled.p`
    font-size: 28px;
`

const Smallp = styled.p`
    font-size: 24px;
    color: white;
`

// 공통 부분 끝 --------------------------------------------

// Header 시작
const Header = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #282828;
    display: flex;
    position: relative;
`

const Tawon = styled.div`
    width: 100%;
    height: 100%;
    background-color: #9c9c9c;
    border-radius: 9999px;
    display: flex;
    align-items: center;
    position: absolute;
    right: 50%;
`

const Tawonwrap = styled.div`
    width: 600px;
    height: 800px;
    /* background-color: white; */
    position: absolute;
    left:1113px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    /* position: none; */
`
const Textbox = styled.div`
    width: 50%;
    height: 100%;
    /* background-color: dodgerblue; */
    position: absolute;
    right: 0;
    display: flex;
    align-items: center;
    padding: 0 153px 0 12px;
`

const Textboxwrap = styled.div`
    width: 100%;
    height: 800px;
    background-color:yellow ;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
`
const TextboxwrapHome = styled.div`
    width: 100%;
    height: 100px;
    background-color: yellowgreen ;
`
const TextboxwrapAbout = styled.div`
    width: 90%;
    height: 100px;
    background-color: yellowgreen ;
`
const TextboxwrapEd = styled.div`
    width: 100%;
    height: 100px;
    background-color: yellowgreen ;
`
const TextboxwrapPo = styled.div`
    width: 100%;
    height: 100px;
    background-color: yellowgreen ;
`
const TextboxwrapFi = styled.div`
    width: 100%;
    height: 100px;
    background-color: yellowgreen ;
`

const Title = styled.div`

`
// Header 끝 ----------------------------------------------
function Home(){
    return(
        <>
            <Container>
                <Header>
                    <Tawon>
                        <Tawonwrap>
                            <H1>프론트엔드 개발자&<br></br>웹퍼블리셔<br></br>희망하는 전준희입니다.</H1>
                            <P>저는 프론트엔드 개발과 웹퍼블리셔를 공부하고 있는 전준희 입니다. React와 JavaScript를 주로 다루며, 웹 개발을 통해 사용자 경험을 개선하는 것을 즐기고 있습니다.</P>
                            <Smallp>좋게봐주시면 감사하겠습니다.!!<br></br>잘부탁드립니다.</Smallp>
                        </Tawonwrap>
                    </Tawon>
                    <Textbox>
                        <Textboxwrap>
                            <TextboxwrapHome></TextboxwrapHome>
                            <TextboxwrapAbout></TextboxwrapAbout>
                            <TextboxwrapEd></TextboxwrapEd>
                            <TextboxwrapPo></TextboxwrapPo>
                            <TextboxwrapFi></TextboxwrapFi>
                        </Textboxwrap>
                    </Textbox>
                </Header>
            </Container>
        </>
    )
}

export default Home
